import {searchEmployees} from './util/API';
function Employee(){
    const employeeList = searchEmployees
    return(
        <div className="employee">
            <ul className='employee-list'>
                {employeeList.map((employee)=>(
                    <div className="name">
                        {employee.name.first}
                    </div>
                ))}
            </ul>
        </div>
    )
}

export default Employee;
